import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import jsonData from "./JSON_Dat.json"
const data = [
  {    
    "title": "Content",
    "id": "4.137b.610236dcc-c9b6.4cc16d678",
    "attr": {
      "position": [
        -1080,
        -301,
        1
      ],
      "style": {
        "background": "#0000FF"
      }
    }
  }, 
  {
    "id": 2,
    "gender": "Male",
    "first_name": "Carlos",
    "last_name": "Fowler",
    "email": "cfowler1@gnu.org",
    "ip_address": "214.248.201.11"
  }];

  function loops(){ 

    return data.map((para) => <a> {para.email} </a>)

  }

const qwert = data.map((para) => 
    <a> {para.first_name} </a>
)

const mappedData = jsonData.map((para) => 
    <div> {para.attr.style.background} </div>
)

class App extends Component {

  render() {

    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
          <div>{loops()}</div>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
  }
}

export default App;
